import React from 'react'
import Typed from 'react-typed'
import '../css/Home.css'
import Particles from 'react-particles-js'
export default function home() {
    return (
        <div>
            <div className="main-info">
                 <Particles 
                            params={{
                                particles: {
                                    number :{
                                        value : 30,
                                        density :{
                                            enable :true , value_area : 900
                                        }
                                    },shape:{
                                        type : "star",
                                        stroke : {
                                            width : 6,
                                            color :"#f9ab00"
                                        }
                                    }
                                }
                            }}
                        />
                    <Typed 
                        className ="typed-text"
                        strings = {["Men's  Sneakers" , "Nike Shows" , "Nike Sondal" , "Men's running Shoes" , "Kid's Shoes"]}
                        typeSpeed = {40}
                        backSpeed = {25}
                        loop
                    />
            </div>
        </div>
    )
}
